package xstt

import (
	"context"
	"os"
	"testing"
)

var data = `
{"type":"audio","format":"webm","size":34937,"speed":1,"compression":"medium","processed":false,"data":""}	
`

func TestOpenAI_SpeechToText(t *testing.T) {
	stt := NewOpenAI(WithAPIKey(os.Getenv("OPENAI_API_KEY")), WithAPIUrl(os.Getenv("OPENAI_BASE_URL")))
	res, err := stt.SpeechToText(context.Background(), SpeechToTextReq{
		Audio: "audio.mp3",
	})
	if err != nil {
		t.Fatalf("SpeechToText failed: %v", err)
	}
	t.Logf("SpeechToText result: %v", res)
}
